import React from 'react';
import { View, Text, StyleSheet } from 'react-native';
import { Button } from 'react-native-paper';
import { logout } from '../../utils/auth'; // Import your logout logic

export default function HomepageScreen({ navigation }) {
  const handleLogout = async () => {
    try {
      // Call your logout function from auth.ts
      await logout();
      // Navigate to the login screen after logout
      navigation.navigate('Login');
    } catch (error) {
      console.error('Logout error:', error);
    }
  };

  const handleQuizButtonPress = () => {
    // Navigate to the Quiz screen when the Quiz button is pressed
    navigation.navigate('EnneagramQuiz');
  };

  const handleAssistantButtonPress = () => {
   // Navigate to the Assistant screen when the Assistant button is pressed
   navigation.navigate('Chat');
  };


  return (
    <View style={styles.container}>
      <Text>Welcome to the Homepage</Text>

      <Button
        mode="contained"
        onPress={handleQuizButtonPress}
        style={{ margin: 10 }}
      >
        EnneagramQuiz
      </Button>

      <Button
        mode="contained"
        onPress={handleAssistantButtonPress}
        style={{ margin: 10 }}
      >
        Assistant
      </Button>

      <Button
        mode="outlined"
        onPress={handleLogout}
        style={{ margin: 10 }}
      >
        Logout
      </Button>
    </View>
  );
}

const styles = StyleSheet.create({
  container: { flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: 'red',
  },
  card: {
    marginVertical: 10,
    padding: 16,
    backgroundColor: 'white',
    borderRadius: 8,
    elevation: 4,
    shadowOpacity: 0.2,
    shadowRadius: 4,
    shadowOffset: {
      width: 0,
      height: 2,
    },
  },
  resultText: {
    fontSize: 16,
    marginTop: 10,
  },
  button: {
    margin: 10,
    maxWidth: 400,
  },
});
